"vs/editor/common/config/commonEditorConfig":["編輯器","控制字型家族。","控制字型寬度。","控制字型大小 (以像素為單位)。","控制行高。使用 0 會從 fontSize 計算 lineHeight。","控制字元間距 (以像素為單位)","不顯示行號。","行號以絕對值顯示。","行號以目前游標的相對值顯示。","每 10 行顯示行號。","控制行號的顯示。","在特定的等寬字元數之後轉譯垂直尺規。有多個尺規就使用多個值。若陣列為空，則不繪製任何尺規。","執行文字相關導覽或作業時將作為文字分隔符號的字元","與 Tab 相等的空格數量。當 `editor.detectIndentation` 已開啟時，會根據檔案內容覆寫此設定。","必須是 'number'。請注意，值 \"auto\" 已由 `editor.detectIndentation` 設定取代。","與 Tab 相等的空格數量。當 `editor.detectIndentation` 已開啟時，會根據檔案內容覆寫此設定。","必須是 'boolean'。請注意，值 \"auto\" 已由 `editor.detect Indentation` 設定取代。","開啟檔案時，會依據檔案內容來偵測 `editor.tabSize` 及 `editor.insertSpaces`。","控制選取範圍是否有圓角","控制編輯器是否會捲動到最後一行之後","控制編輯器是否會使用動畫捲動","控制是否會顯示迷你地圖","控制要在哪端呈現迷你地圖。","自動隱藏迷你地圖滑桿","呈現行內的實際字元 (而不是彩色區塊)","限制迷你地圖的寬度，以呈現最多的資料行","控制編譯器選取範圍是否預設為尋找工具的搜尋字串","控制編譯器內選取多字元或多行內文是否開啟選取範圍尋找功能","控制尋找小工具是否在 macOS 上讀取或修改共用尋找剪貼簿  ","一律不換行。","依檢視區寬度換行。","於 'editor.wordWrapColumn' 換行。","當檢視區縮至最小並設定 'editor.wordWrapColumn' 時換行。","控制是否自動換行。可以是:\n - 'off' (停用換行),\n - 'on' (檢視區換行),\n - 'wordWrapColumn' (於 'editor.wordWrapColumn' 換行`) 或\n - 'bounded' (當檢視區縮至最小並設定 'editor.wordWrapColumn' 時換行).","當 `editor.wordWrap` 為 [wordWrapColumn] 或 [bounded] 時，控制編輯器中的資料行換行。","控制換行的縮排。可以是 [無]、[相同] 或 [縮排]。","滑鼠滾輪捲動事件的 'deltaX' 與 'deltaY' 所使用的乘數","對應 Windows 和 Linux 的 `Control` 與對應 macOS 的 `Command`","對應 Windows 和 Linux 的 `Alt` 與對應 macOS 的 `Option`","用於新增多個滑鼠游標的修改。 `ctrlCmd` 會對應到 Windows 和 Linux 上的 `Control` 以及 macOS 上的 `Command`。 [移至定義] 及 [開啟連結] 滑鼠手勢將會適應以避免和 multicursor 修改衝突。","在重疊時合併多個游標。","允許在字串內顯示即時建議。","允許在註解中顯示即時建議。","允許在字串與註解以外之處顯示即時建議。","控制是否應在輸入時自動顯示建議","控制延遲顯示快速建議的毫秒數","當您輸入時啟用彈出視窗，顯示參數文件與類型資訊","控制編輯器是否應在左括號後自動插入右括號","控制編輯器是否應在輸入一行後自動格式化","控制編輯器是否應自動設定貼上的內容格式。格式器必須可供使用，而且格式器應該能夠設定文件中一個範圍的格式。","控制當使用者輸入, 貼上或移行時，編輯器應自動調整縮排。語言的縮排規則必須可用","控制輸入觸發字元時，是否應自動顯示建議","控制除了 'Tab' 外，是否也藉由按下 'Enter' 接受建議。如此可避免混淆要插入新行或接受建議。設定值'smart'表示在文字變更同時，只透過Enter接受建議。","控制認可字元是否應接受建議。例如在 JavaScript 中，分號 (';') 可以是接受建議並鍵入該字元的認可字元。","將程式碼片段建議顯示於其他建議的頂端。","將程式碼片段建議顯示於其他建議的下方。","將程式碼片段建議與其他建議一同顯示。","不顯示程式碼片段建議。","控制程式碼片段是否隨其他建議顯示，以及其排序方式。","控制複製時不選取任何項目是否會複製目前程式行。","控制是否應根據文件中的單字計算自動完成。","一律選取第一個建議。","除非進一步的鍵入選取一個建議，否則選取最近的建議。例如，因為 `log` 最近完成，所以 `console.| -> console.log`。","根據先前已完成這些建議的首碼選取建議。例如，`co -> console` 與 `con -> const`。","控制在顯示建議清單時如何預先選取建議。","建議小工具的字型大小","建議小工具的行高","控制編輯器是否應反白顯示與選取範圍相似的符合項","控制編輯器是否應反白顯示出現的語意符號","控制可在概觀尺規中相同位置顯示的裝飾項目數","控制是否應在概觀尺規周圍繪製邊框。","控制游標動畫樣式。","使用滑鼠滾輪並按住 Ctrl 時，縮放編輯器的字型","控制游標樣式。接受的值為 'block'、'block-outline'、'line'、'line-thin'、'underline' 及 'underline-thin'","控制游標寬度，當 editor.cursorStyle 設定為 'line' 時。","啟用連字字型","控制游標是否應隱藏在概觀尺規中。","控制編輯器轉譯空白字元的方式，可能為 'none'、'boundary' 及 'all'。'boundary' 選項不會轉譯字組間的單一空格。","控制編輯器是否應顯示控制字元","控制編輯器是否應顯示縮排輔助線","控制編輯器應如何轉譯目前反白的行，可能的值有 'none'、'gutter'、'line' 和 'all'。","控制編輯器是否顯示 CodeLens","控制編輯器是否已啟用程式碼摺疊功能","如果可行，請使用語言特定摺疊策略，否則請退回至縮排式策略。","一律使用縮排式摺疊策略","控制折疊範圍的計算方式。'auto' 會在可行的情況下挑選使用語言特定摺疊策略。'indentation' 則會強制使用縮排式摺疊策略。","自動隱藏摺疊控制向","當選取某側的括號時，強調顯示另一側的配對括號。","控制編輯器是否應轉譯垂直字符邊界。字符邊界最常用來進行偵錯。","插入和刪除接在定位停駐點後的空白字元","移除尾端自動插入的空白字元","讓預覽編輯器在使用者按兩下其內容或點擊 Escape 時保持開啟。","控制編輯器是否允許透過拖放動作移動選取範圍。","編輯器將使用平台 API 以偵測螢幕助讀程式附加。","編輯器將會為螢幕助讀程式的使用方式永久地最佳化。","編輯器不會為螢幕助讀程式的使用方式進行最佳化。","控制編輯器是否應於已為螢幕助讀程式最佳化的模式中執行。","控制編輯器是否應偵測連結且讓它可點擊","控制編輯器是否應轉譯內嵌色彩裝飾項目與色彩選擇器。","啟用程式動作燈泡提示","要在儲存時執行組織匯入嗎?","要在儲存時執行的程式碼動作種類。","儲存時執行的程式碼動作逾時。","控制是否應支援 Linux 主要剪貼簿。","控制 Diff 編輯器要並排或內嵌顯示差異","控制 Diff 編輯器是否將開頭或尾端空白字元的變更顯示為差異","針對大型檔案停用部分高記憶體需求功能的特殊處理方式。","控制 Diff 編輯器是否要為新增的/移除的變更顯示 +/- 標記"],
